            array('key' => 'about-us-section','value' => '{"image":"f9a15e26-6865-418f-b8ee-5853c67ef736.webp","language":{"en":{"title":"About Us","heading":"At iBanking, we\\u2019re redefining the future of banking. From secure online transactions to effortless account management, we put control in your hands.","sub_heading":"Welcome to iBanking, where modern banking meets simplicity and security. Our platform empowers you to manage your finances with ease\\u2014whether it\\u2019s transferring funds, monitoring transactions, or accessing statements. With cutting-edge security, 24\\/7 access, and an intuitive design, we make banking convenient, secure, and tailored to your needs. Experience banking reimagined\\u2014simple, secure, and always within reach."},"es":{"title":"Sobre nosotras","heading":"En iBanking, estamos redefiniendo el futuro de la banca. Desde transacciones seguras en l\\u00ednea hasta una gesti\\u00f3n de cuentas sencilla, ponemos el control en sus manos.","sub_heading":"Bienvenido a iBanking, donde la banca moderna se combina con la simplicidad y la seguridad. Nuestra plataforma le permite administrar sus finanzas con facilidad, ya sea que se trate de transferir fondos, monitorear transacciones o acceder a sus estados de cuenta. Con seguridad de vanguardia, acceso las 24 horas, los 7 d\\u00edas de la semana y un dise\\u00f1o intuitivo, hacemos que la banca sea conveniente, segura y personalizada seg\\u00fan sus necesidades. Experimente una banca reinventada: simple, segura y siempre a su alcance."},"ar":{"title":"\\u0645\\u0639\\u0644\\u0648\\u0645\\u0627\\u062a \\u0639\\u0646\\u0627","heading":"\\u0641\\u064a iBanking\\u060c \\u0646\\u0639\\u0645\\u0644 \\u0639\\u0644\\u0649 \\u0625\\u0639\\u0627\\u062f\\u0629 \\u062a\\u0639\\u0631\\u064a\\u0641 \\u0645\\u0633\\u062a\\u0642\\u0628\\u0644 \\u0627\\u0644\\u062e\\u062f\\u0645\\u0627\\u062a \\u0627\\u0644\\u0645\\u0635\\u0631\\u0641\\u064a\\u0629. \\u0628\\u062f\\u0621\\u064b\\u0627 \\u0645\\u0646 \